import React from "react";
import SearchBar from "./SearchBar";
import _ from "lodash";

class App extends React.Component {
  constructor() {
    super();

    this.state = {
      stocks: [],
      term: null,
      value: "",
    };
  }

  onTermSubmit = (data) => {
    let stocks = data["Time Series (Daily)"].map((time) => [
      {
        open: time["1. open"],
        high: time["2. high"],
        low: time["3. low"],
        close: time["4. close"],
      },
    ]);

    console.log(stocks);
    console.log(data);
  };

  render() {
    return (
      <div className=" ui container">
        <SearchBar onTermSubmit={this.onTermSubmit} />
      </div>
    );
  }
}

export default App;
